import React from "react";
import { useSelector } from "react-redux";
import {Row, Col, Skeleton} from 'antd';
import { getDataMainWeather, getStatusFinishData } from "../reselects/weatherReselect";
import { createStructuredSelector } from 'reselect';
import {helper} from '../helpers/common';


const ResultWeather = () => {
    const {finishStatus, dataWeather} = useSelector(createStructuredSelector)
    return (
        <>
        <Row>
            <Col span={20} offset={2}>
                <p>Thong tin thoi tiet cua thanh pho: Ha Noi</p>
            </Col>
        </Row>
        </>
    )
}

export default React.memo(ResultWeather);
